import { Link } from "react-router-dom";

function Nav() {
    return (
      <div className="App">
          <nav>
              <li>Home</li>
              <li>Sejarah</li>
              <li>Tentang</li>
              <li>Kontak</li>
          </nav>
      </div>
    );
}

export default Nav;
